import React from 'react'
import './historic.css'

function Historic() {
    return (
        <div
            style={{
                width: '100%',
                paddingTop: '20px'
            }}
        >
            <details
                style={{
                    width: '75%',
                    margin: 'auto'
                }}
            >
                <summary>Historic</summary>
                <div>
                    <p>Historic</p>
                </div>
            </details>
        </div>
    )
}

export default Historic
